import React, { Component } from 'react';

class AddPage extends Component {
  constructor(props) {
    super(props);
    this.state = {
      Name: '',
      Avail: '',
      Price: ''
    };
  }
  render() {
    return (
      <div>
        <input type='number' name='' value={this.state.Name} />
        <input type='number' name='' value={this.state.Avail} />
        <input type='number' name='' value={this.state.Price} />
      </div>
    );
  }
}

export default AddPage;
